import React from 'react'
import MainBanner from '../PageBanners/MainBannerOne';
import Welcome from '../Common/Welcome';
import Navigation from '../Navigation/Navigation';
import About from '../Common/About';
import Strategy from '../Common/Strategy';
import WhoWeAre from '../Common/WhoWeAre';
import Ctr from '../Common/Ctr';
import Skill from '../Common/Skill';
import Funfact from '../Common/Funfact';
import Team from '../Common/Team';
import HowWeWork from '../Common/HowWeWork';
import Services from '../Common/Services';
import WhyWeDifferent from '../Common/WhyWeDifferent';
import Work from '../Common/Work';
import Price from '../Common/Price';
import Faq from '../Common/Faq';
import Testimonial from '../Common/Testimonial';
import Blog from '../Common/Blog';
import Partner from '../Common/Partner';
import Subscribe from '../Common/Subscribe';
import Contact from '../Common/Contact';
import Footer from '../Common/Footer';
import GoTop from '../Common/GoTop';
 
class HomeOne extends React.Component {
    render(){
        return (
            <React.Fragment>
                <Navigation />

                {/* Main Banner */}
                <MainBanner />
                {/* Welcome Area */}
                <Welcome />
                {/* About Area */}
                {/* <About /> */}
                {/* Strategy Area */}
                {/* <Strategy /> */}
                {/* Who We Are Area */}
                {/* <WhoWeAre /> */}
                {/* CTR Area */}
                {/* <Ctr /> */}
                {/* Skill Area */}
                {/* <Skill /> */}
                {/* Fact Area */}
                {/* <Funfact /> */}
                {/* Team Area */}
                {/* <Team /> */}
                {/* How We Work */}
                {/* <HowWeWork /> */}
                {/* Services Area */}
                <Services />
                {/* Why We Are Different */}
                <WhyWeDifferent />
                {/* Work Area */}
                <Work />
                {/* Price Area */}
                {/* <Price /> */}
                {/* FAQ Area */}
                {/* <Faq /> */}
                {/* Testimonials Area */}
                <Testimonial />
                {/* Blog Area */}
                <Blog />
                {/* Partner Area */}
                {/* <Partner /> */}
                {/* Subscribe Area */}
                {/* <Subscribe /> */}
                {/* Contact Area */}
                <Contact />
                {/* Footer Area */}
                <Footer />
                <GoTop scrollStepInPx="100" delayInMs="16.66" />
            </React.Fragment>
        );
    }
}
 
export default HomeOne;
